def get_indexer(
        self,
        target: AnyArrayLike,
        method: Optional[str] = None,
        limit: Optional[int] = None,
        tolerance: Optional[Any] = None,
    ) -> np.ndarray:

        self._check_method(method)

        if len(self) == 0:
            return np.array([], dtype="intp")

        target_as_index = ensure_index(target)

        if isinstance(self, type(target_as_index)):
            if self.equals(target_as_index):
                return np.arange(len(self), dtype="intp")

        # Convert target to IntervalIndex if it's not already
        if not isinstance(target_as_index, IntervalIndex):
            target_as_index = IntervalIndex.from_arrays(
                target_as_index.left, target_as_index.right, closed=target_as_index.closed, name=target_as_index.name
            )

        left_indexer = self.left.get_indexer(target_as_index.left)
        right_indexer = self.right.get_indexer(target_as_index.right)
        indexer = np.where(left_indexer == right_indexer, left_indexer, -1)

        return indexer
